import React, { useEffect, useState } from "react";
import { Col, Collapse, Container, Row } from "react-bootstrap";
import { useNavigate } from "react-router-dom";
import Swal from "sweetalert2";
import CardProduct from "../components/CardProduct";

function Dashboard() {
  const [dtsession, setDtsession] = useState(null);
  const [dtnama, setNama] = useState("");
  const [dtrole, setRole] = useState("");
  const history = useNavigate();

  useEffect(() => {
    if (
      sessionStorage.getItem("access_token") == null ||
      sessionStorage.getItem("access_token") == "undefined"
    ) {
      Swal.fire({
        position: "top-center",
        icon: "info",
        title: "Just Info",
        html: "Anda belum login",
        showConfirmButton: false,
        timer: 2000,
      });
      history("/");
    } else {
      let get_dtsession = JSON.parse(sessionStorage.getItem("data"));
      setDtsession(get_dtsession);
      setNama(get_dtsession.data.name);
      setRole(get_dtsession.data.role);
    }
  }, []);
  return (
    <>
      <Container className="py-5">
        <h5>
          <i>
            Hallo <b>{dtnama}</b>, anda login sebagai {""}
            <b>{dtrole}</b>
          </i>
        </h5>
        <Row>
          <Col className="text-center my-2">
            <h2>Ayo Berlangganan Layanan Kami</h2>
            <p style={{ color: "#233dff", fontStyle: "italic" }}>
              <b>
                CYBERNET adalah sebuah internet provider terbaik di Indonesia.
                CYBERNET Bangkit Bersatu Untuk Indonesia, dengan menjunjung
                tinggi nilai-nilai Nasionalisme, CYBERNET berniat memberikan
                yang terbaik untuk masyarakat Indonesia
              </b>
            </p>
          </Col>
        </Row>
        <Row xs={1} md={3} className="g-2">
          {/* {Array.from({ length: 4 }).map((_, idx) => ( */}
          <CardProduct
            image="p01.png"
            title="INTERNET BRONZE"
            desc="UP TO 50Mbps"
            price="500000"
            disc="10"
          />
          <CardProduct
            image="p02.png"
            title="INTERNET SILVER"
            desc="UP TO 150Mbps"
            price="1500000"
            disc="15"
          />
          <CardProduct
            image="p03.png"
            title="INTERNET GOLD"
            desc="UP TO 250Mbps"
            price="2300000"
          />
          {/* ))} */}
        </Row>
      </Container>
    </>
  );
}

export default Dashboard;
